import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Orders.css';

const Orders = () => {
  // Mock data for orders - in a real app, this would come from an API
  const initialOrders = [
    {
      id: '1001',
      customerName: 'דנה כהן',
      email: 'dana@email.com',
      date: '16/04/2025',
      meals: 'סלט קינואה, שייק ירוק',
      quantities: '1, 2',
      status: 'בטיפול'
    },
    {
      id: '1002',
      customerName: 'רועי לוי',
      email: 'roi@email.com',
      date: '16/04/2025',
      meals: 'חזה עוף עם בטטה',
      quantities: '3',
      status: 'נשלח'
    },
    {
      id: '1003',
      customerName: 'מיכל אברהם',
      email: 'michal@email.com',
      date: '15/04/2025',
      meals: 'סלט השף, מרק עדשים',
      quantities: '1, 1',
      status: 'הושלם'
    }
  ];

  const [orders, setOrders] = useState(initialOrders);
  const [confirmMessage, setConfirmMessage] = useState('');
  const [orderToDelete, setOrderToDelete] = useState(null);

  // Handle delete confirmation
  const handleDeleteClick = (order) => {
    setOrderToDelete(order);
    setConfirmMessage(`האם אתה בטוח שברצונך למחוק את הזמנה מספר #${order.id}?`);
  };

  // Handle delete confirmation
  const confirmDelete = () => {
    if (orderToDelete) {
      setOrders(orders.filter(order => order.id !== orderToDelete.id));
      setConfirmMessage('');
      setOrderToDelete(null);
    }
  };

  // Cancel delete
  const cancelDelete = () => {
    setConfirmMessage('');
    setOrderToDelete(null);
  };

  // Get status class based on status text
  const getStatusClass = (status) => {
    switch (status) {
      case 'בטיפול':
        return 'pending';
      case 'נשלח':
        return 'sent';
      case 'הושלם':
        return 'completed';
      default:
        return '';
    }
  };

  return (
    <div className="orders-container">
      <header>
        <h1>מערכת ניהול הזמנות</h1>
        <nav>
          <Link to="/admin">דף מנהל</Link>
          <Link to="/">חזרה לאתר</Link>
          <Link to="/admin/delete-meal">מחיקת מנות</Link>
          <Link to="/admin/add-meal">הוספת מנות</Link>
        </nav>
      </header>

      <main>
        {confirmMessage && (
          <div className="confirm-dialog">
            <p>{confirmMessage}</p>
            <div className="confirm-actions">
              <button onClick={confirmDelete} className="confirm-btn">כן, מחק</button>
              <button onClick={cancelDelete} className="cancel-btn">ביטול</button>
            </div>
          </div>
        )}

        <h2>רשימת הזמנות</h2>
        <table>
          <thead>
            <tr>
              <th>מס'</th>
              <th>שם הלקוח</th>
              <th>אימייל</th>
              <th>תאריך</th>
              <th>מנות</th>
              <th>כמות</th>
              <th>סטטוס</th>
              <th>פעולה</th>
            </tr>
          </thead>
          <tbody>
            {orders.map(order => (
              <tr key={order.id}>
                <td>#{order.id}</td>
                <td>{order.customerName}</td>
                <td>{order.email}</td>
                <td>{order.date}</td>
                <td>{order.meals}</td>
                <td>{order.quantities}</td>
                <td>
                  <span className={`status ${getStatusClass(order.status)}`}>
                    {order.status}
                  </span>
                </td>
                <td>
                  <Link to={`/update-order?id=${order.id}`} className="btn-update">עדכן</Link>
                  <button 
                    className="btn-delete"
                    onClick={() => handleDeleteClick(order)}
                  >
                    מחק
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </main>

      <footer>
        <p>כל הזכויות שמורות</p>
      </footer>
    </div>
  );
};

export default Orders;
